int fastTable[501][501];

int convert(string str) {
    return (int) strtol(str.c_str(), NULL, 16);
}

void init() {
    for (int i = 0; i <= 500; i++) {
        assert(table[i].size() % 9 == 0);
        for (int j = 0; j < table[i].size(); j += 9) {
            int A = convert(table[i].substr(j, 3));
            int B = convert(table[i].substr(j + 3, 3));
            int C = convert(table[i].substr(j + 6, 3));
            for (int a = A; a < B; a++) {
                fastTable[i][a] = C;
            }
        }
    }
}

int dfs(int x, int b, int r) {
    if (dp[x][b].count(r)) return dp[x][b][r];
    if (x > b) return 0;

    int ans = 0;
    for (int i = 0; i <= r; i++) {
        if (b - x * (i + 1) < 0) break;
        if (r - i * (i + 1) / 2 < 0) break;
        ans = max(dfs(x + 1, b - x * (i + 1), r - i * (i + 1) / 2) + i + 1, ans);
    }
    return dp[x][b][r] = ans;
}

int fast(int r, int b) {
    return fastTable[r][b];
}


